import React from 'react'

export const ResponseOK = () => {
    return (
        <>
          <img src="../assets/img/ok.png" alt="success" className="screen3__ico" />
          <h2>¡Tu Password Manager ya está creado!</h2>
          <h3>Ya puedes disfrutar de los beneficios del servicio.</h3>
          <button className="btn btn-primary screen3__button" type="submit">Siguiente <i className="bi bi-chevron-right"></i></button>
        </>
    )
}
